import React from "react";
import image from "../utils/images/Resume.png";

const pageMargins = {
  marginTop: '5%',
  marginLeft: '5%',
  marginRight: '5%',
  width: '80%',
  background: 'rgba(0, 0, 0, 0.2)',
  padding: '2% 5%',
  borderRadius: '6px',
  fontSize: '22px'
};

function Resume() {

  return (
    <div>
      <div style={pageMargins}>
      <img src={image} width alt=""></img>
      </div>
    </div>
  );
}

export default Resume;
